/* Task creates taxed periodical pay-out account for application of a banksavings product.
For regular applications: - When the deposit is received within the quotation period then the highest interest rate (interest rate sinds the moment of appplication and interrest rate at the deposit moment) will be applied. - When the deposit is received after the quotation period the actual interest rate will be applied. - NN/ACH set interest scale in table rekening_renteconditie while AAB the interest rate. Recalculation of the interest rate and pay-out amount is required due to fiscal laws.
For non-regular applications such as inheritance, split due to divorce etc... - Interest rate and amount will be inherited from de testator (AAB or testator was migrated from external system). - Interest scale will be inherited from de testator (NN, ACH) */
